package com.example.infopelis;

import com.example.infopelis.Models.Pelicula;

import org.junit.Before;
import org.junit.Test;
import static org.junit.Assert.*;

/**
 * Example local unit test, which will execute on the development machine (host).
 *
 * @see <a href="http://d.android.com/tools/testing">Testing documentation</a>
 */
public class ExampleUnitTest {

    private Pelicula p= new Pelicula();

    @Before
    public void setUp() {
        this.p = new Pelicula();
    }


    @Test
    public void probarId(){
        assertEquals(false, this.p.setId(-1));
        assertEquals(true, this.p.setId(1));
        assertEquals("1", this.p.getId().toString());
    }

    @Test
    public void probarTitulo() {
        assertEquals(false, this.p.setTitulo(""));
        assertEquals(true, this.p.setTitulo("Cenicienta"));
        assertEquals("Cenicienta", this.p.getTitulo());
    }

    @Test
    public void probarFecha() {
        assertEquals(false, this.p.setFecha("29/02/2019"));
        assertEquals(true, this.p.setFecha("20/02/2020"));
        assertEquals("20/02/2020", this.p.getFecha());
    }

    @Test
    public void probarDuracion() {
        assertEquals(false, this.p.setDuracion("1000"));
        assertEquals(true, this.p.setDuracion("100"));
        assertEquals("100", this.p.getDuracion());

    }

    @Test
    public void probarDirector() {
        assertEquals(false, this.p.setDirector("antonio  33"));
        assertEquals(true, this.p.setDirector("Antonio Manuel"));
        assertEquals("Antonio Manuel", this.p.getDirector());

    }

    @Test
    public void probarEstrenado() {
        assertEquals(true, this.p.setEstreno(1));
        assertEquals(false, this.p.setEstreno(2));
        assertEquals("1", this.p.getEstreno().toString());
    }

    @Test
    public void probarImagen() {
        this.p.setImage("");
        assertEquals("",
                this.p.getImage());

    }

    @Test
    public void probarComentario() {
        assertEquals(true, this.p.setComentario("Me ha gustado"));
        assertEquals("Me ha gustado", this.p.getComentario());
        assertEquals(false, this.p.setComentario(""));
    }

    @Test
    public void probarCategoria() {
        assertEquals(false, this.p.setCategoria("Aade..."));
        assertEquals(true, this.p.setCategoria("Infantil"));
        assertEquals("Infantil", this.p.getCategoria());
    }


}